import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";
import axios from "axios";
import { RootState } from "../../app/store";

const apiURL = process.env.SEND_EMAIL;

// メール送信処理
export const fetchAsyncSendEmail = createAsyncThunk(
  "send/email",
  async (values) => {
    console.log(apiURL);
    console.log(values);
    // const res = await axios.post(`${apiURL}`, values, {
    //   headers: {
    //     "Content-Type": "application/json",
    //   },
    // });
    // return res.data;
  }
);
const emailSlice = createSlice({
  name: "email",
  initialState: {},
  reducers: {},
  // extraReducer追加
  extraReducers: (builder) => {
    builder.addCase(fetchAsyncSendEmail.fulfilled, (state, action) => {
      state.myprofile = action.payload;
    });
  },
});

console.log(emailSlice);

// export const { fetchAsyncSendEmail } = emailSlice.actions;

// Reducerをエクスポートする
export default emailSlice;
